// greater returns x>y.
func greater(x, y V) V {
	if x.IsI() {
		return greaterIV(x.I(), y)
	}
	if x.IsF() {
		return greaterFV(x.F(), y)
	}
	switch xv := x.value.(type) {
	case S:
		return greaterSV(xv, y)
	case *AB:
		return greaterABV(xv, y)
	case *AF:
		return greaterAFV(xv, y)
	case *AI:
		return greaterAIV(xv, y)
	case *AS:
		return greaterASV(xv, y)
	case *AV:
		switch yv := y.value.(type) {
		case *Dict:
			v := greater(x, NewV(yv.values))
			if v.IsPanic() {
				return v
			}
			v.InitRC()
			return NewV(&Dict{keys: yv.keys, values: v.value.(array)})
		case array:
			if yv.Len() != xv.Len() {
				return Panicf("x>y : length mismatch: %d vs %d", xv.Len(), yv.Len())
			}
			r := xv.reuse()
			for i, xi := range xv.Slice {
				ri := greater(xi, yv.at(i))
				if ri.IsPanic() {
					return ri
				}
				r.Slice[i] = ri
			}
			return NewV(r)
		}
		r := xv.reuse()
		for i, xi := range xv.Slice {
			ri := greater(xi, y)
			if ri.IsPanic() {
				return ri
			}
			r.Slice[i] = ri
		}
		return NewV(r)
	case *Dict:
		yv, ok := y.value.(*Dict)
		if ok {
			r := dictArith(xv, yv, greater)
			if r.IsPanic() {
				return ppanic("d>d", r)
			}
			return r
		}
		v := greater(NewV(xv.values), y)
		if v.IsPanic() {
			return v
		}
		v.InitRC()
		return NewV(&Dict{keys: xv.keys, values: v.value.(array)})
	default:
		return panicTypeElt("x>y", "x", x)
	}
}

