func subtract(x, y V) V {
	if x.IsI() {
		return subtractIV(x.I(), y)
	}
	if x.IsF() {
		return subtractFV(x.F(), y)
	}
	switch xv := x.value.(type) {
	case S:
		return subtractSV(xv, y)
	case *AB:
		return subtractABV(xv, y)
	case *AF:
		return subtractAFV(xv, y)
	case *AI:
		return subtractAIV(xv, y)
	case *AS:
		return subtractASV(xv, y)
	case *AV:
		switch yv := y.value.(type) {
		case *Dict:
			v := subtract(x, NewV(yv.values))
			if v.IsPanic() {
				return v
			}
			v.InitRC()
			return NewV(&Dict{keys: yv.keys, values: v.value.(array)})
		case array:
			if yv.Len() != xv.Len() {
				return Panicf("x-y : length mismatch: %d vs %d", xv.Len(), yv.Len())
			}
			r := xv.reuse()
			for i, xi := range xv.Slice {
				ri := subtract(xi, yv.at(i))
				if ri.IsPanic() {
					return ri
				}
				r.Slice[i] = ri
			}
			return NewV(r)
		}
		r := xv.reuse()
		for i, xi := range xv.Slice {
			ri := subtract(xi, y)
			if ri.IsPanic() {
				return ri
			}
			r.Slice[i] = ri
		}
		return NewV(r)
	case *Dict:
		yv, ok := y.value.(*Dict)
		if ok {
			r := dictArith(xv, yv, subtract)
			if r.IsPanic() {
				return ppanic("d-d", r)
			}
			return r
		}
		v := subtract(NewV(xv.values), y)
		if v.IsPanic() {
			return v
		}
		v.InitRC()
		return NewV(&Dict{keys: xv.keys, values: v.value.(array)})
	default:
		return panicTypeElt("x-y", "x", x)
	}
}

