// multiply returns x*y.
func multiply(x, y V) V {
	if x.IsI() {
		return multiplyIV(x.I(), y)
	}
	if x.IsF() {
		return multiplyFV(x.F(), y)
	}
	switch xv := x.value.(type) {
	case S:
		return multiplySV(xv, y)
	case *AB:
		return multiplyABV(xv, y)
	case *AF:
		return multiplyAFV(xv, y)
	case *AI:
		return multiplyAIV(xv, y)
	case *AS:
		return multiplyASV(xv, y)
	case *AV:
		switch yv := y.value.(type) {
		case *Dict:
			v := multiply(x, NewV(yv.values))
			if v.IsPanic() {
				return v
			}
			v.InitRC()
			return NewV(&Dict{keys: yv.keys, values: v.value.(array)})
		case array:
			if yv.Len() != xv.Len() {
				return Panicf("x*y : length mismatch: %d vs %d", xv.Len(), yv.Len())
			}
			r := xv.reuse()
			for i, xi := range xv.Slice {
				ri := multiply(xi, yv.at(i))
				if ri.IsPanic() {
					return ri
				}
				r.Slice[i] = ri
			}
			return NewV(r)
		}
		r := xv.reuse()
		for i, xi := range xv.Slice {
			ri := multiply(xi, y)
			if ri.IsPanic() {
				return ri
			}
			r.Slice[i] = ri
		}
		return NewV(r)
	case *Dict:
		yv, ok := y.value.(*Dict)
		if ok {
			r := dictArith(xv, yv, multiply)
			if r.IsPanic() {
				return ppanic("d*d", r)
			}
			return r
		}
		v := multiply(NewV(xv.values), y)
		if v.IsPanic() {
			return v
		}
		v.InitRC()
		return NewV(&Dict{keys: xv.keys, values: v.value.(array)})
	default:
		return panicTypeElt("x*y", "x", x)
	}
}

