// maximum returns x|y.
func maximum(x, y V) V {
	if x.IsI() {
		return maximumIV(x.I(), y)
	}
	if x.IsF() {
		return maximumFV(x.F(), y)
	}
	switch xv := x.value.(type) {
	case S:
		return maximumSV(xv, y)
	case *AB:
		return maximumABV(xv, y)
	case *AF:
		return maximumAFV(xv, y)
	case *AI:
		return maximumAIV(xv, y)
	case *AS:
		return maximumASV(xv, y)
	case *AV:
		switch yv := y.value.(type) {
		case *Dict:
			v := maximum(x, NewV(yv.values))
			if v.IsPanic() {
				return v
			}
			v.InitRC()
			return NewV(&Dict{keys: yv.keys, values: v.value.(array)})
		case array:
			if yv.Len() != xv.Len() {
				return Panicf("x|y : length mismatch: %d vs %d", xv.Len(), yv.Len())
			}
			r := xv.reuse()
			for i, xi := range xv.Slice {
				ri := maximum(xi, yv.at(i))
				if ri.IsPanic() {
					return ri
				}
				r.Slice[i] = ri
			}
			return NewV(r)
		}
		r := xv.reuse()
		for i, xi := range xv.Slice {
			ri := maximum(xi, y)
			if ri.IsPanic() {
				return ri
			}
			r.Slice[i] = ri
		}
		return NewV(r)
	case *Dict:
		yv, ok := y.value.(*Dict)
		if ok {
			r := dictArith(xv, yv, maximum)
			if r.IsPanic() {
				return ppanic("d|d", r)
			}
			return r
		}
		v := maximum(NewV(xv.values), y)
		if v.IsPanic() {
			return v
		}
		v.InitRC()
		return NewV(&Dict{keys: xv.keys, values: v.value.(array)})
	default:
		return panicTypeElt("x|y", "x", x)
	}
}

